import React, { useState } from 'react';
import { Button, Container, Grid, IconButton, Drawer } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import CloseIcon from '@mui/icons-material/Close';
import logo from '../../assets/logo.png';
import message from '../../assets/contact.png';
import { Link } from 'react-scroll';

const Navbar = () => {
    const [mobileOpen, setMobileOpen] = useState(false);

    const links = [
        { label: "Home", to: "home" },
        { label: "About", to: "about" },
        { label: "Experience", to: "Experience" },
        { label: "Projects", to: "Projects" },
    ];

    return (
        <div style={{ background: "rgb(30,30,30)", color: "white" }}>

            <Grid
                container
                alignItems="center"
                justifyContent="space-between"

                py='20px'
                sx={{
                    position: 'sticky',
                    top: 0,
                    px: { md: "70px", xs: '10px' },
                    zIndex: 1209, // Make sure it's above Drawer default (1200)
                    backgroundColor: 'rgb(30,30,30)'
                }}

            >
                {/* Left Logo */}
                < Grid item xs={6} md={2}>
                    <img src={logo} alt="logo" style={{ height: '60px', cursor: 'pointer' }} />
                </Grid>

                {/* Desktop Nav Links */}
                <Grid
                    item
                    xs={0}
                    md={7}
                    sx={{ display: { xs: 'none', md: 'flex' }, justifyContent: 'center', gap: 3 }}
                >
                    {links.map((link) => (
                        <Button
                            key={link.to}
                            sx={{
                                color: 'white',
                                textTransform: 'none',
                                fontWeight: 'bold',
                                fontSize: 'large',
                                position: 'relative',
                                '&::after': {
                                    content: '""',
                                    position: 'absolute',
                                    left: 0,
                                    bottom: 0,
                                    width: '0%',
                                    height: '3px',
                                    backgroundColor: 'yellow',
                                    transition: 'width 0.3s ease-in-out',
                                },
                                '&:hover::after': {
                                    width: '100%',
                                },
                            }}
                        >
                            <Link to={link.to} smooth={true} duration={500}>
                                {link.label}
                            </Link>
                        </Button>

                    ))}
                </Grid>

                {/* Right Contact Button (Desktop) */}
                <Grid
                    item
                    xs={0}
                    md={3}
                    sx={{ display: { xs: 'none', md: 'flex' }, justifyContent: 'flex-end' }}
                >
                    <Button
                        variant="contained"
                        sx={{
                            background: 'white',
                            color: 'black',
                            fontWeight: 'bold',
                            display: 'flex',
                            alignItems: 'center',
                            gap: 1.5,
                            textTransform: 'none',
                            padding: '6px 16px',
                        }}
                    >
                        <img src={message} alt="message icon" style={{ width: 20, height: 20 }} />
                        Contact Me
                    </Button>
                </Grid>

                {/* Mobile Menu Icon */}
                <Grid item xs={6} md={0} sx={{ display: { xs: 'flex', md: 'none' }, justifyContent: 'flex-end' }}>
                    <IconButton onClick={() => setMobileOpen(true)} sx={{ color: "white" }}>
                        <MenuIcon />
                    </IconButton>
                </Grid>
            </Grid>


            {/* Mobile Drawer */}
            <Drawer
                anchor="right"
                open={mobileOpen}
                onClose={() => setMobileOpen(false)}
                PaperProps={{
                    sx: {
                        width: 250,
                        backgroundColor: "rgb(30,30,30)",
                        color: "white",
                        display: "flex",
                        flexDirection: "column",
                    }
                }}
            >
                {/* Drawer Header with Close Icon */}
                <Grid
                    container
                    alignItems="center"
                    justifyContent="space-between"
                    sx={{
                        px: 2,
                        py: 1.5,
                        borderBottom: '1px solid rgba(255,255,255,0.1)',
                    }}
                >
                    <Grid item>
                        <img src={logo} alt="logo" style={{ height: '40px' }} />
                    </Grid>
                    <Grid item>
                        <IconButton onClick={() => setMobileOpen(false)} sx={{ color: "white" }}>
                            <CloseIcon />
                        </IconButton>
                    </Grid>
                </Grid>

                {/* Nav Links */}
                <div style={{ paddingTop: 16 }}>
                    {links.map((link) => (
                        <Button
                            key={link.to}
                            component={Link}
                            to={link.to}
                            smooth={true}
                            duration={500}
                            // onClick={() => setMobileOpen(false)}
                            sx={{
                                color: 'white',
                                textTransform: 'none',
                                fontWeight: 'bold',
                                justifyContent: 'flex-start',
                                px: 3,
                                py: 1.5,
                                width: '100%',
                                fontSize: '1rem',
                            }}
                        >
                            {link.label}
                        </Button>
                    ))}
                </div>

                {/* Contact Button */}
                <Button
                    variant="contained"
                    sx={{
                        background: 'white',
                        color: 'black',
                        fontWeight: 'bold',
                        display: 'flex',
                        alignItems: 'center',
                        gap: 1.5,
                        textTransform: 'none',
                        padding: '6px 16px',
                        width: "80%",
                        alignSelf: 'center',
                        mt: 3,
                    }}
                >
                    <img src={message} alt="message icon" style={{ width: 20, height: 20 }} />
                    Contact Now
                </Button>
            </Drawer>



        </div >
    );
};

export default Navbar;
